import React from "react";
import meRing from "../..//Assets/meRing.png";
import { motion, useScroll } from "framer-motion";
import "./Hero.css";
const Hero = () => {
  const { scrollYProgress } = useScroll();

  return (
    <motion.div
      className="rectangle"
      initial={{
        opacity: 0,
        x: 1000,
      }}
      animate={{
        opacity: 1,
        x: 0,
      }}
    >
      <section className="hero">
        <img src={meRing} alt="myProfile-img" draggable="false" />
      </section>
    </motion.div>
  );
};
export default Hero;
